using namespace std;

int main() {
    // Daftar menu dan paket makanan beserta harganya
    map<string, int> menuPrices = {
        {"Ayam Goreng Sambal Bawang", 13000},
        {"Ayam Goreng Kremes", 15000},
        {"Ayam Goreng Extra", 20000},
        {"Nasi Goreng Spesial", 15000},
        {"Nasi Goreng Bakso", 13000},
        {"Nasi Goreng Jumbo", 17000},
        {"Ikan Bakar Madu Pedas", 17000},
        {"Ikan Bakar Spesial", 18000},
        {"Ikan Bakar Pedas", 15000}
    };

    // Variable untuk menyimpan pesanan dan total pembayaran
    map<string, int> orders;
    int totalPayment = 0;

    // Loop program
    while (true) {
        // Menampilkan menu pilihan
        cout << "=== Menu Makanan ===" << endl;
        for (const auto& item : menuPrices) {
            cout << item.first << " : Rp. " << item.second << endl;
        }

        // Meminta input dari user
        cout << "Pilih makanan atau ketik 'selesai' untuk menyelesaikan pesanan: ";
        string userInput;
        getline(cin, userInput);

        // Keluar dari loop jika user memilih 'selesai'
        if (userInput == "selesai") {
            break;
        }

        // Memeriksa apakah makanan tersedia
        if (menuPrices.find(userInput) == menuPrices.end()) {
            cout << "Maaf, makanan tidak tersedia. Silakan pilih makanan lain." << endl;
            continue;
        }

        // Meminta jumlah pemesanan
        cout << "Masukkan jumlah pemesanan: ";
        int quantity;
        cin >> quantity;

        // Menambahkan pesanan ke daftar
        orders[userInput] += quantity;

        // Menghitung total pembayaran
        totalPayment += (menuPrices[userInput] * quantity);

        // Membersihkan buffer input
        cin.ignore();
    }

    // Menghitung diskon
    double discount = totalPayment * 0.1;

    // Menampilkan ringkasan pesanan
    cout << "\n=== Ringkasan Pesanan ===" << endl;
    for (const auto& order : orders) {
        cout << order.first << " : " << order.second << " porsi" << endl;
    }

    // Menampilkan total pembayaran dan diskon
    cout << "\nTotal Pembelian: Rp. " << totalPayment << endl;
    cout << "Diskon 10%: Rp. " << discount << endl;
    cout << "Total Pembayaran Setelah Diskon: Rp. " << totalPayment - discount << endl;

    return 0;
}

