#include <Wire.h>
#include <RTClib.h>

// Sambungkan pin SDA ke pin A4 dan pin SCL ke pin A5 pada Arduino untuk modul RTC
RTC_DS3231 rtc;

// Tentukan pin yang akan digunakan untuk mengontrol relay atau pompa penyiraman
const int relayPin = 2; // Ganti dengan pin yang sesuai

// Tentukan pin yang akan digunakan untuk indikator LED standby
const int standbyLedPin = 13; // Ganti dengan pin yang sesuai

// Tentukan pin yang akan digunakan untuk indikator LED penyiraman
const int wateringLedPin = 12; // Ganti dengan pin yang sesuai

// Waktu penyiraman dalam menit
const int wateringDuration = 60;

void setup() {
  Serial.begin(9600);

  // Periksa apakah modul RTC terdeteksi
  if (!rtc.begin()) {
    Serial.println("Couldn't find RTC");
    while (1);
  }

  // Periksa apakah waktu pada modul RTC sudah diatur
  if (rtc.lostPower()) {
    Serial.println("RTC lost power, let's set the time!");
    rtc.adjust(DateTime(F(__DATE__), F(__TIME__)));
  }

  // Set pin relay dan LED sebagai OUTPUT
  pinMode(relayPin, OUTPUT);
  pinMode(standbyLedPin, OUTPUT);
  pinMode(wateringLedPin, OUTPUT);
}

void loop() {
  // Baca waktu dari modul RTC
  DateTime now = rtc.now();

  // Set jadwal penyiraman (contoh: penyiraman setiap hari pukul 08:00)
  int targetHour = 8;
  int targetMinute = 0;

  // Bandingkan waktu sekarang dengan jadwal penyiraman
  if (now.hour() == targetHour && now.minute() == targetMinute) {
    // Waktu penyiraman tercapai, aktifkan indikator dan relay
    digitalWrite(wateringLedPin, HIGH);
    digitalWrite(standbyLedPin, LOW);
    digitalWrite(relayPin, HIGH);
    Serial.println("Penyiraman aktif!");

    // Tunggu selama waktu penyiraman yang ditentukan
    delay(wateringDuration * 60 * 1000);

    // Matikan indikator dan relay setelah waktu penyiraman selesai
    digitalWrite(wateringLedPin, LOW);
    digitalWrite(relayPin, LOW);
    Serial.println("Penyiraman selesai, menunggu waktu berikutnya...");
  } else {
    // Waktu penyiraman belum tercapai, aktifkan indikator standby dan matikan relay
    digitalWrite(standbyLedPin, HIGH);
    digitalWrite(wateringLedPin, LOW);
    digitalWrite(relayPin, LOW);
    Serial.println("Menunggu waktu penyiraman...");
  }

  // Tambahkan delay untuk menghindari pembacaan yang terus-menerus
  delay(1000);
}

