bool SearchLocatorParser::parse(const QString& input)
{
    _data = input;
    _iterator = _data.begin();
    _lastError = Error::NoError;

    return parse();
}

SearchLocatorParser::Error SearchLocatorParser::lastError() const
{
    return _lastError;
}

QVariantMap SearchLocatorParser::locator() const
{
    return _rootContainer;
}

bool SearchLocatorParser::parse()
{
    while (1)
    {
        switch (currentToken())
        {
        case TokenType::Space:
            ++_iterator;
            break;

        case TokenType::OpenBrace:
            ++_iterator;
            return parseContainer(_rootContainer);

        default:
            _lastError = Error::IllegalValue;
            return false;
        }
    }

    Q_UNREACHABLE();
    return false;
}

bool SearchLocatorParser::parseContainer(QVariantMap& result)
{
    while (1)
    {
        switch (currentToken())
        {
        case TokenType::Letter:
            if (!parseProperty(result))
            {
                return false;
            }
            ++_iterator;
            break;
        case TokenType::Space:
            ++_iterator;
            break;
        case TokenType::CloseBrace:
            return true;
        default:
            return raiseIllegalValue();
        }
    }

    Q_UNREACHABLE();
    return false;
}

bool SearchLocatorParser::parseProperty(QVariantMap& container)
{
    QString propertyName;
    if (!parsePropertyName(propertyName))
    {
        return false;
    }

    if (currentToken() != TokenType::EqualSign)
    {
        return raiseIllegalValue();
    }

    ++_iterator;
    QVariant propertyValue;

    switch (currentToken())
    {
    case TokenType::Quote:
        {
            ++_iterator;
            QString value;
            if (!parsePropertyValue(value))
            {
                return false;
            }

            propertyValue = value;
        }
        break;
    case TokenType::OpenBrace:
        {
            ++_iterator;
            QVariantMap propertyContainer;
            if (!parseContainer(propertyContainer))
            {
                return false;
            }

            propertyValue = propertyContainer;
        }
        break;
    default:
        return raiseIllegalValue();
    }

    container.insert(propertyName, propertyValue);
    return true;
}

bool SearchLocatorParser::parsePropertyName(QString& name)
{
    while (1)
    {
        switch (currentToken())
        {
        case TokenType::Other:
            if (name.isEmpty())
            {
                return raiseIllegalValue();
            }
            name.append(*_iterator++);
            break;
        case TokenType::Letter:
            name.append(*_iterator++);
            break;
        default:
            return true;
        }
    }

    Q_UNREACHABLE();
    return false;
}

bool SearchLocatorParser::parsePropertyValue(QString& out)
{
    while (1)
    {
        switch (currentToken())
        {
        case TokenType::Quote:
            return true;
        case TokenType::End:
            return raiseIllegalValue();
        default:
            out.append(*_iterator++);
            break;
        }
    }

    Q_UNREACHABLE();
    return false;
}

SearchLocatorParser::TokenType SearchLocatorParser::currentToken() const
{
    if (_iterator == _data.end())
    {
        return TokenType::End;
    }
    if (*_iterator == QLatin1Char('{'))
    {
        return TokenType::OpenBrace;
    }
    if (*_iterator == QLatin1Char('}'))
    {
        return TokenType::CloseBrace;
    }
    if (*_iterator == QLatin1Char('='))
    {
        return TokenType::EqualSign;
    }
    if (*_iterator == QLatin1Char('\''))
    {
        return TokenType::Quote;
    }
    if (_iterator->isLetter())
    {
        return TokenType::Letter;
    }
    if (_iterator->isSpace())
    {
        return TokenType::Space;
    }

    return TokenType::Other;
}

bool SearchLocatorParser::raiseIllegalValue()
{
    _lastError = Error::IllegalValue;
    return false;
}

